css:
.nuclide-ui-message {
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 2px;
  margin: 5px;
  padding: 10px;
  border-left-width: 5px;
  line-height: 2;
}
.nuclide-ui-message-default {
  border-color: #555;
}
.nuclide-ui-message-error {
  color: #c00;
  border-color: #c00;
}
.nuclide-ui-message-info {
  color: #5293d8;
  border-color: #5293d8;
}
.nuclide-ui-message-success {
  color: #2BDA77;
  border-color: #2BDA77;
}
.nuclide-ui-message-warning {
  color: #ff982d;
  border-color: #ff982d;
}
